INSERT INTO `competition` VALUES (1,1,'Karya Tulis Jurnalistik','KETENTUAN UMUM KOMPETISI\n\n1. Peserta terbagi menjadi 2: kategori jurnalis media massa di Indonesia dan kategori umum.\n\n2. Peserta adalah Warga Negara Indonesia yang memiliki identitas resmi.\n\n3. Karya asli, bukan terjemahan, saduran, atau rangkuman.\n\n4. Karya tidak memuat unsur SARA.\n\n5. Penerimaan karya mulai 28 Agustus sampai dengan 22 Oktober 2019 melalui microsite http://praja2019.multiintisarana.com.\n\n6. Peserta bukan karyawan MIS Group dan afiliasinya. \n\n7. Panitia berhak mendiskualifikasi peserta sebelum dan sesudah penjurian apabila ditemukan bukti kecurangan.\n\nKETENTUAN KHUSUS KOMPETISI\n\n1. Karya sudah pernah dipublikasikan di media massa tempat peserta tercatat sebagai pekerja resmi [dibuktikan dengan surat keterangan] dan/atau media sosial peserta selama periode 1 November 2018 - 20 Oktober 2019.\n\n2. Pemuatan karya di media sosial wajib menggunakan tagar:\n#PRAJA2019 #koperasi #koperasidigital #wirausaha\n\n3. Jika tidak memiliki media daring, maka karya tulis yang telah dipublikasikan di media cetak diunggah ke Google Drive [diatur terbuka] dan pranalanya dikirimkan ke microsite.\n\n4. Panjang karya tulisan 3.000 s/d 12.000 karakter.\n\n5. Karya yang disertai ilustrasi foto dan infografis akan mendapatkan poin tambahan.\n\n6. Peserta dapat mengirimkan maksimal 2 [dua] judul karya tulis.\n\nHADIAH\n\n- Juara 1 : Rp. 20.000.000;\n- Juara 2 : Rp. 15.000.000;\n- Juara 3 : Rp. 10.000.000;\n','2019-08-28 00:00:00','2019-11-03 11:00:00',1,1,'2019-08-16 12:54:06','/jurnalistik.jpeg'),(2,1,'Karya Foto Jurnalistik','KETENTUAN UMUM KOMPETISI\n\n1.	Peserta terbagi menjadi 2: kategori jurnalis media massa di Indonesia dan kategori umum.\n\n2.	Peserta adalah Warga Negara Indonesia yang memiliki identitas resmi.\n\n3.	Karya asli, bukan terjemahan, saduran, atau rangkuman.\n\n4.	Karya tidak memuat unsur SARA.\n\n5.	Penerimaan karya mulai 28 Agustus sampai dengan 22 Oktober 2019 melalui microsite http://praja2019.multiintisarana.com.\n\n6.	Peserta bukan karyawan MIS Group dan afiliasinya.\n\n7.	Panitia berhak mendiskualifikasi peserta sebelum dan sesudah penjurian apabila ditemukan bukti kecurangan.\r\rKETENTUAN KHUSUS KOMPETISI\n\n1.	Karya sudah pernah dipublikasikan di media massa dan/atau media sosial peserta selama periode 1 November 2018 - 20 Oktober 2019.\n\n2.	Pemuatan karya di media sosial wajib menggunakan tagar: \r#PRAJA2019 #koperasi #koperasidigital #wirausaha\n\n3.	Jika tidak memiliki media daring, maka karya foto yang telah dipublikasikan di media cetak diunggah ke Google Drive [diatur terbuka] dan pranalanya dikirimkan ke microsite.\n\n4.	Ukuran sisi panjang foto minimal 3.500 piksel, sisi pendek menyesuaikan serta disimpan dalam format JPG minimal skala 10.\n\n5.	Peserta dapat mengirimkan maksimal 5 [lima] karya foto.\n\nHADIAH\n\n- Juara 1 : Rp. 20.000.000;\n- Juara 2 : Rp. 15.000.000;\n- Juara 3 : Rp. 10.000.000;\r','2019-08-28 00:00:00','2019-11-03 11:00:00',1,1,'2019-08-16 12:54:19','/foto.jpeg'),(3,1,'Karya Blog','KETENTUAN UMUM KOMPETISI\n\n1.	Peserta terbagi menjadi 2: kategori jurnalis media massa di Indonesia dan kategori umum.\n\n2.	Peserta adalah Warga Negara Indonesia yang memiliki identitas resmi.\n\n3.	Karya asli, bukan terjemahan, saduran, atau rangkuman.\n\n4.	Karya tidak memuat unsur SARA.\n\n5.	Penerimaan karya mulai 28 Agustus sampai dengan 22 Oktober 2019 melalui microsite http://praja2019.multiintisarana.com.\n\n6.	Peserta bukan karyawan MIS Group dan afiliasinya.\n\n7.	Panitia berhak mendiskualifikasi peserta sebelum dan sesudah penjurian apabila ditemukan bukti kecurangan.\r\rKETENTUAN KHUSUS KOMPETISI\n\n1.	Diikuti Jurnalis dan Umum melalui halaman blog pribadi.\n\n2.	Usia blog minimal 6 [enam] bulan.\n\n3.	Blog yang diikutsertakan boleh menggunakan domain self-hosted [TLD] ataupun platform gratis.\n\n4.	Menyertakan kata kunci \"koperasi digital\", \"koperasi zaman now\", \"koperasi dan generasi milenial\" [salah satu] pada judul blog atau isi artikel.\n\n5.	Tulisan yang dibuat terdiri dari 400 - 1.000 kata.\n\n6.	Tulisan belum pernah diikutkan dalam kompetisi blog lainnya.\n\n7.	Pranala tulisan blog wajib dimuat di media sosial peserta menggunakan tagar #PRAJA2019 #anugerahMISGroup #koperasi #wirausaha.\n\n8.	Peserta wajib mengikuti akun sosial media:\n	•	Facebook: PRAJA MIS GROUP, dan Multi Inti Sarana Group\n	•	Instagram: @praja.misgroup dan @multiintisaranagroup, dan\n	•	Twitter: @prajamisgroup\n\nHADIAH\n\n- Juara 1 : Rp. 10.000.000;\n- Juara 2 : Rp. 7.000.000;\n- Juara 3 : Rp. 5.000.000;','2019-08-28 00:00:00','2019-11-03 11:00:00',1,1,'2019-08-16 12:54:30','/blog.jpeg'),(4,1,'Karya Video Kreatif','KETENTUAN UMUM KOMPETISI\n\n1.	Peserta terbagi menjadi 2: kategori jurnalis media massa di Indonesia dan kategori umum.\n\n2.	Peserta adalah Warga Negara Indonesia yang memiliki identitas resmi.\n\n3.	Karya asli, bukan terjemahan, saduran, atau rangkuman.\n\n4.	Karya tidak memuat unsur SARA.\n\n5.	Penerimaan karya mulai 28 Agustus sampai dengan 22 Oktober 2019 melalui microsite http://praja2019.multiintisarana.com.\n\n6.	Peserta bukan karyawan MIS Group dan afiliasinya.\n\n7.	Panitia berhak mendiskualifikasi peserta sebelum dan sesudah penjurian apabila ditemukan bukti kecurangan.\r\rKETENTUAN KHUSUS KOMPETISI\n\n1.	Karya video pernah ditayangkan di media massa dan/atau media sosial di periode 1 November 2018 -  20 Oktober 2019.\n\n2.	Peserta mengunggah hasil karya video ke Google Drive [diatur terbuka] dan mengirimkan pranalanya ke microsite.\n\n3.	Durasi karya video 5 sampai 10 menit.\n\n4.	Karya tidak memuat pelanggaran etika, SARA, pornografi, dan gambar video dari video lain.\n\n5.	Karya video belum pernah memenangi kompetisi video lainnya.\n\nHADIAH\n\n- Juara 1 : Rp. 20.000.000;\n- Juara 2 : Rp. 15.000.000;\n- Juara 3 : Rp. 10.000.000;\r','2019-08-28 00:00:00','2019-11-03 11:00:00',1,1,'2019-08-16 12:54:44','/video.jpeg'),(6,1,'Karya Ide Bisnis Koperasi','KETENTUAN UMUM KOMPETISI\n\r1.	Peserta terbagi menjadi 2: kategori jurnalis media massa di Indonesia dan kategori umum.\n\n2.	Peserta adalah Warga Negara Indonesia yang memiliki identitas resmi.\n\n3.	Karya asli, bukan terjemahan, saduran, atau rangkuman.\n\n4.	Karya tidak memuat unsur SARA.\n\n5.	Penerimaan karya mulai 28 Agustus sampai dengan 22 Oktober 2019 melalui microsite http://praja2019.multiintisarana.com.\n\n6.	Peserta bukan karyawan MIS Group dan afiliasinya.\n\n7.	Panitia berhak mendiskualifikasi peserta sebelum dan sesudah penjurian apabila ditemukan bukti kecurangan.\r\rKETENTUAN KHUSUS KOMPETISI\n\n1.	Peserta adalah profesional, pengurus koperasi, mahasiswa, dan umum.\n\n2.	Peserta mengirimkan proposal ide bisnisnya dalam bentuk lanskap format pdf dan/atau disertai video presentasi durasi maksimal 5 menit dengan resolusi standar minimal 480p, dan berformat lanskap dengan cara mengunggahnya ke Google Drive [diatur terbuka] dan mengirimkan pranalanya ke microsite.\n\n3.	Video presentasi disertai pula dengan presentasi bisnis [powerpoint] yang diunggah ke Google Drive dan mengirimkan akses pranala tersebut ke microsite.\n\n4.	Struktur dokumen presentasi bisa diunduh di microsite.\n\n5.	Ide belum pernah diikutsertakan dalam lomba sejenis lainnya dengan menyertakan surat pernyataan yang dapat diunduh di microsite.\n\n6.	Konten ide bisnis mencakup:\n	•	Inovasi Program dan Produk Koperasi dan Usaha Kecil Menengah [Latar Belakang, Analisa Peluang Pasar, Challenge, dan Ancaman]\n	•	Ide Penggunaan Teknologi Digital dalam Manajemen Koperasi\n	•	Ide Pengelolaan SDM\n	•	Ide Program Pemasaran, Promosi, dan Distribusi\n	•	Ide Pengelolaan Keuangan\n\n7.	Sebanyak 10 karya finalis akan direkomendasikan ke Kementerian Koperasi dan Usaha Kecil dan Menengah RI.\n\nHADIAH\n\n- Juara 1 : Rp. 10.000.000;\n- Juara 2 : Rp. 7.000.000;\n- Juara 3 : Rp. 5.000.000;\r','2019-08-28 00:00:00','2019-11-03 11:00:00',1,1,'2019-08-16 12:55:08','/bisnis.jpeg');
